import string
STRING_INPUT = """"""
TEST_INPUT = """dabAcCaCBAcCcaDA"""

def day5_part1(inputString):
    found = []
    i = 0
    for c in inputString:
        if (not found):
            found.append(c)
            continue
        if (c.islower() and found[-1].isupper()):
            if (c.upper() == found[-1]):
                del found[-1]
            else:
                found.append(c)
        elif (c.isupper() and found[-1].islower()):
            if (c.lower() == found[-1]):
                del found[-1]
            else:
                found.append(c)
        else:
            found.append(c)
        i += 1
    return ''.join(found), len(found)

def manualStrip(string, chars):
    return "".join(c for c in string if c not in chars)

def day5_part2(inputString):
    alphabet = string.ascii_lowercase
    lenght = []
    outs = []
    for a in alphabet:
        chars = a
        chars += a.upper()
        out, size = day5_part1(manualStrip(inputString, chars))
        outs.append(out)
        lenght.append(size)
    return outs, lenght
